import React from "react";
import { LogoMobile, LogoDesktop, MenuIcon, CrossIcon } from "../../icons";
import styles from "./Navbar.module.scss";

function Navbar() {
  const navigationOptions = [
    {
      id: 1,
      title: "Головна",
      linkContainer: "main",
    },
    {
      id: 2,
      title: "Галерея",
      linkContainer: "gallery",
    },
    {
      id: 3,
      title: "Команда",
      linkContainer: "team",
    },
    {
      id: 4,
      title: "Послуги та ціни",
      linkContainer: "price",
    },
    {
      id: 5,
      title: "Сертифікати",
      linkContainer: "certificates",
    },
    {
      id: 6,
      title: "Контакти",
      linkContainer: "contacts",
    },
  ];

  return (
    <nav className={styles.navbarWrapper}>
      <div className={styles.navbarlogo}>
        <LogoMobile className={styles.logoMobile} />
        <LogoDesktop className={styles.logoDesktop} />
      </div>
      <ul className={styles.navbarLinks}>
        {navigationOptions.map(({ id, linkContainer, title }) => (
          <li key={id}>
            <a href={`#${linkContainer}`}>{title}</a>
          </li>
        ))}
      </ul>

      {/* mobile */}

      <div className="app__navbar-menu">
        <MenuIcon onClick={() => setToggle(true)} />

        {/* {toggle && (
          <motion.div
